import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Header from "./components/Header";
import BackgroundVideo from "./components/BackgroundVideo";
import Register from "./components/auth/Register";
import Login from "./components/auth/Login";
import DashBoard from './components/DashBoard';
 // Assuming you have a Dashboard component
import Profile from "./components/Profile";

function App() {
  return (
    <Router>
      <div className="app-container">
        <BackgroundVideo /> {/* Background video remains common */}
        <Header /> {/* Header remains common */}

        <Routes>
          <Route path="/" element={<Navigate to="/login" />} /> {/* Default to Login */}
          <Route path="/login" element={<Login open={true} onClose={() => {}} onLogin={() => {}} />} />
          <Route path="/register" element={<Register open={true} onClose={() => {}} />} />
          <Route path="/dashboard" element={<DashBoard />} /> {/* After login, show UserBoard */}
          <Route path="/profile" element={<Profile />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
